import React, { Component } from "react";
import { connect } from "react-redux";
import Table from "@material-ui/core/Table";

import TableBody from "@material-ui/core/TableBody";
import TableCell from "@material-ui/core/TableCell";
import TableContainer from "@material-ui/core/TableContainer";
import TableHead from "@material-ui/core/TableHead";
import TableRow from "@material-ui/core/TableRow";
import Paper from "@material-ui/core/Paper";
import { getBanks } from "../Saga";

// import Navbar from "../../Components/Navbar";
// import { Link } from "react-router-dom";

class BankTable extends Component {
  constructor(props) {
    super(props);
    this.state = {
      banks: [],
    };
  }

  componentDidMount() {
    this.props.dispatch(getBanks());
  }

  componentWillReceiveProps(props) {
    if (props.banks) {
      this.setState({
        banks: props.banks,
      });
    }
  }

  render() {
    return (
      <>
        <div style={{ marginRight: "10%", marginLeft: "10%", marginTop: "5%" }}>
          <TableContainer component={Paper}>
            <Table aria-label="simple table">
              <TableHead style={{ background: "grey" }}>
                <TableRow>
                  <TableCell>Id</TableCell>
                  <TableCell align="center">Bank</TableCell>
                  <TableCell align="center">IFSC</TableCell>
                  <TableCell align="center">Branch </TableCell>
                  <TableCell align="center">Bank ID</TableCell>
                  <TableCell align="center">Address</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {this.state.banks.map((bank, index) => (
                  <TableRow>
                    <TableCell component="th" scope="row">
                      {bank.id}
                    </TableCell>
                    <TableCell align="center">{bank.bank_name}</TableCell>
                    <TableCell align="center">{bank.ifsc}</TableCell>
                    <TableCell align="center">{bank.branch}</TableCell>
                    <TableCell align="center">{bank.bank_id}</TableCell>
                    <TableCell align="center">{bank.address}</TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer>
        </div>
      </>
    );
  }
}

const mapStateToProps = (state) => {
  return {
    banks: state.reducer.banks,
  };
};

export default connect(mapStateToProps)(BankTable);
